import { AxiosRequestConfig } from 'axios';
import Pagination from 'components/Pagination';
import { useCallback, useEffect, useState } from 'react';
import { Link, useHistory } from 'react-router-dom';
import { User } from 'types/user';
import { SpringPage } from 'types/vendor/spring';
import { requestBackend } from 'util/requests';
import { FaEdit, FaTrash } from 'react-icons/fa';
import './styles.css';
import { debounce } from 'lodash';

type UserFilterData = {
  searchTerm: string;
  property: string;
};

type ControlComponentsData = {
  activePage: number;
  filterData: UserFilterData;
};

const List = () => {

  const [page, setPage] = useState<SpringPage<User>>();
  const [controlComponentsData, setControlComponentsData] = useState<ControlComponentsData>({
    activePage: 0,
    filterData: { 
      searchTerm: '',
      property: 'firstName'
    },
  });

  const history = useHistory();

  function handleEdit(userId: number) {
    history.push(`/record/users/${userId}`);
  };

  const handleDelete = (userId: number) => {

    if (!window.confirm("Tem certeza que deseja deletar?")) {
      return;
    }

    const config: AxiosRequestConfig = {
      method: 'DELETE',
      url: `/users/${userId}`,
    };

    requestBackend(config).then((response) => {
      history.go(0);
      setPage(response.data);
      history.go(0);
    });
  };

  const handlePageChange = (pageNumber: number) => {
    setControlComponentsData({ activePage: pageNumber, filterData: controlComponentsData.filterData });
  };

  const handleSearch = (event: React.ChangeEvent<HTMLInputElement>) => {
    const searchTerm = event.target.value;
    const data = {
      ...controlComponentsData,
      filterData: {
        ...controlComponentsData.filterData,
        searchTerm: searchTerm
      }
    }

    setControlComponentsData(data);
  };

  const handlePropertyFilterChange = (event: React.ChangeEvent<HTMLSelectElement>) => {
    const property = event.target.value;
    const data = {
      ...controlComponentsData,
      filterData: {
        ...controlComponentsData.filterData,
        property: property
      }
    }
    setControlComponentsData(data);
  }

  const getUsers = useCallback(() => {
    const config: AxiosRequestConfig = {
      method: 'GET',
      url: '/users',
      params: {
        page: controlComponentsData.activePage,
        size: 5,
        ...(controlComponentsData.filterData || {}),
      },

    };

    requestBackend(config).then((response) => {
      setPage(response.data);
    });

  }, [controlComponentsData]);

  const debounceHandleSearch = useCallback(
    debounce(handleSearch, 1000)
  ,[controlComponentsData.filterData])

  useEffect(() => {
    getUsers();
  }, [getUsers, controlComponentsData.filterData]);

  return (
    <><div className='input-container'>
      <Link to={`/record/users/create`}>
        <button className="btn btn-primary text-white btn-crud-add">
          Adicionar
        </button>
      </Link>
      <div className='search-container'>
        <input
          type='text'
          placeholder='Pesquisar'
          onChange={debounceHandleSearch}
        />

          <select onChange={handlePropertyFilterChange}>
            <option value="firstName">Nome</option>
            <option value="lastName">Sobrenome</option>
            <option value="email">Email</option>
          </select>
      </div>
    </div>

      <div className="container">
        <h1>Lista de usuários</h1>
        <table className="table">
          <thead>
            <tr>
              <th>Nome</th>
              <th>Sobrenome</th>
              <th>E-mail</th>
              <th>Ações</th>
            </tr>
          </thead>
          <tbody>
            {page?.content.map(user => (
              <tr key={user.id}>
                <td>{user.firstName}</td>
                <td>{user.lastName}</td>
                <td>{user.email}</td>
                <td>
                  <button type="button" onClick={() => handleEdit(user.id)} style={{ marginRight: '10px' }}>
                    <FaEdit />
                  </button>
                  <button type="button" onClick={() => handleDelete(user.id)} style={{ marginRight: '10px' }}>
                    <FaTrash />
                  </button>
                </td>
              </tr>
            ))}

          </tbody>
        </table>
        {<Pagination
          forcePage={page?.number}
          pageCount={(page?.totalPages || 0)}
          range={page?.size || 0}
          onChange={handlePageChange} />}
      </div>
    </>
  )


}

export default List;
